import { Link } from "react-router-dom";
import { useState } from "react";

const Header = ({ Paths }) => {
  const [menu, setMenu] = useState(false);

  const menuToggle = (e) => {
    setMenu(!menu);
    console.log(menu);
  };

  return (
    <nav className="header-area bg-amber-600 text-slate-50 flex justify-between items-center pt-1 pb-1">
      <h1 className="font-bold text-sm md:text-xl lg:text-3xl ml-10 lg:ml-20">
        Iman & Associates Ltd.
      </h1>
      <div onClick={menuToggle} className="burger-menu mr-10">
        <div className="bar"></div>
        <div className="bar"></div>
        <div className="bar"></div>
      </div>
      {/* styling for resposive navbar */}
      <div className="link-area flex flex-col z-10 absolute top-10 right-5 items-center bg-yellow-600 pb-2	">
        <ul className="text-centerflex flex-col mr-8 ">
          <li>
            <Link to={Paths.home}>Home</Link>
          </li>
          <li>
            <Link to={Paths.about}>About</Link>
          </li>
          <li>
            <Link to={Paths.contacts}>Contact</Link>
          </li>
        </ul>
        <button className="btn-primary bg-sky-600	hover:bg-sky-700 pr-4 pl-4 pt-2 pb-2 rounded	">
          Sign In
        </button>
      </div>
    </nav>
  );
};
export default Header;
